import styled from 'styled-components';

export const Div = styled.div`
`

export const Button = styled.button`
  height: 64px;
  width: 64px;
  padding: 8px 16px;
  color: #2D2C2E;
  background-color: transparent;
  opacity: 0.9;
  transition: backdrop-filter  300ms;

  &:hover {
    opacity: 0.9;
    backdrop-filter: blur(200px);
  }
`
